    .then(reponse => {
        return reponse.json()    
    })
    .then(responseData=>{
        return responseData
    })
    .catch(err=> console.log("error: ", err))

    if(action.type === "EMAIL"){
        console.log(data)
        return data
    }
}

export default getEmail
